import React, { Component} from 'react';
import {Row, Col } from 'antd';
import './Intro.css';

class Intro extends Component {
    constructor(props){
        super(props)
    }

    render(){
        return(
            <div className="intro-container">
                <Row>
                    <Col xs={24}>
                        <div className="intro-section">
                            <Row>
                                <Col xs={24}>
                                    <div className="intro-section">
                                        
                                    </div>
                                </Col>
                            </Row>
                        </div>
                    </Col>
                </Row>
            </div>
        )
    }
}
export default Intro;
